import React from 'react';
import ReactDOM from 'react-dom';

const AppHeader = () => {
    return (
        <h1>Hello World</h1>
    );
};

const SearchPanel = () => {
    const searchText = 'Type here to search';
    const searchStyle = {
        fontSize: '20px'
    };
    return (
        <input placeholder={searchText} style={searchStyle}/>
    );
};

const TodoList = () => {
    const item = ['Learn React', 'Build App'];

    return (
        <ul>
            <li>{item[0]}</li>
            <li>{item[1]}</li>
        </ul>
    );
};

const App = () => {
    const loginBox = <span>Log in please</span>
    return (
        <div>
            {loginBox}
            <AppHeader />
            <SearchPanel />
            <TodoList />
        </div>
    );
};

ReactDOM.render(<App/>, document.getElementById('root'));
